package com.servinglynk.hmis.warehouse.core.model;import com.fasterxml.jackson.annotation.JsonProperty;import com.fasterxml.jackson.annotation.JsonRootName;@JsonRootName("serviceStatus")public class ServiceStatus extends ClientModel {	private String status;		public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public String getComment() {		return comment;	}	public void setComment(String comment) {		this.comment = comment;	}	public DeveloperService getService() {		return Service;	}	public void setService(DeveloperService service) {		Service = service;	}	private String comment;		@JsonProperty("developerService")	private DeveloperService Service;}